import styled from 'styled-components';

const TeamGroup = styled.div`
  display: grid;
  grid-template-columns: 30% 70%;
  height: 30px;
  width: 100%;

  .Team1{
    display: grid;
    grid-column-start: 1;
    grid-column-end: 2;
  }

  .team{
    grid-column-start: 1;
    grid-column-end: 2;
    grid-row-start: 1;
    grid-row-end: 2;
  }
`;

export default TeamGroup;
